INSERT INTO `posts` (`id`, `title`, `star`, `labelCode`, `address`, `attributesId`, `categoryCode`, `priceCode`, `areaCode`, `provinceCode`, `description`, `userId`, `overviewId`, `imagesId`, `priceNumber`, `areaNumber`, `createdAt`, `updatedAt`) VALUES
('03bb81bb-7f25-4597-af5b-1e393e77ba9c', 'Cho thuê phòng trọ rộng rãi trong chung cư mini tại Ngõ 256, Nguyễn Lân, Trường Chinh, HN', 'star star-3', 'ONOH', 'Địa chỉ: Số nhà 06 ngõ 256 Phố Nguyễn Lân Đường Trường Chinh, Quận Thanh Xuân, Hà Nội', '172fe704-7387-4269-99bb-e9d957468145', 'NCT', '3U5N', '2UMD', 'NDOE', '[\"Phòng rộng ở được 2 - 3 người\",\"Phòng rộng khép kín đầy đủ tiện nghi: bàn, điêu hòa nóng lạnh, tủ lạnh,...\",\"Giao thông thuận lợi không tắc đường, ngập lụt. \",\"Sinh hoạt giờ giấc tự do. Không chung chủ\",\"Gần đường ô tô có chỗ để ô tô. Giao thông thuận lợi cạnh đường lớn Nguyễn Lân gần chợ, trường đai học lớn Bách Khoa, xây dựng, kinh tế, y, ngân hàng ....\",\"Có chỗ để xe\",\"Nhà cạnh đường lớn giao thông thuận lơi, ko bị tắc đường như Trường Chinh, Lê trọng tấn......\",\"Đc: số nhà 06 ngõ 256 Phố Nguyễn Lân đường Trường Chinh Hà Nội.\",\"Đt liên lạc 0912966199\"]', '7e51fb91-e9db-4f6b-ab36-e5e05cb98d9b', '90d25ca2-517d-4c7c-aa93-323e4add1d9f', '51dccb5b-e900-4717-a331-90ca48428fc7', NULL, NULL, '2023-10-05 00:57:32', '2023-10-05 00:57:32'),
('09490fc6-333b-425a-a3e6-31b5c4f24b88', 'Cho Thuê Phòng Trọ Giá Rẻ Có Chỗ Nấu Ăn, Để Xe', 'star star-4', 'OOPN', 'Địa chỉ: 331/4 Đường Tôn Thất Thuyết, Phường 1, Quận 4, Hồ Chí Minh', 'f977e516-bc32-4c64-8fc6-af23ee35e194', 'NCT', '1U2N', 'ON2E', 'CUID', '[\"Nhà đúc đẹp có phòng cho thuê, gần cầu Nguyễn Văn Cừ khu trung tâm thuận tiện sang các quận 1,3,5,7,8. Phòng tiện nghi. Có WIFI và Chỗ nấu ăn. Nhận 1 đến 2 người và 1xe, giấy tờ đầy đủ. Phòng 1.6 Triệu. Yêu cầu gọi điện trực tiếp cho cô Hiếu. Không Nhận Tin Nhắn.\"]', 'ac068cf2-69d4-40fd-9a45-e1c277126dba', 'd826338c-bf15-40a5-96bc-1ae6fe720a19', 'f0f085ff-643a-4e62-97bc-5e99743dfdfd', NULL, NULL, '2023-10-05 00:57:32', '2023-10-05 00:57:32'),
('09875c4f-24a8-4d3a-88eb-551d37b9c3ba', 'PHÒNG TRỌ ĐỐI DIỆN KS 5 SAO TÂN SƠN NHẤT MỚI XÂY RẤT ĐẸP - GẦN CÔNG VIÊN HOÀNG VĂN THỤ', 'star star-5', 'ONON', 'Địa chỉ: 205/10A-B Đường Hoàng Văn Thụ, Phường 8, Quận Phú Nhuận, Hồ Chí Minh', '68d54db4-5c1f-460e-adff-0d0bdd5c2775', 'CTPT', '5U7N', '2UMD', 'CUID', '[\"- Phòng đẹp nằm ngay trung tâm quận Phú Nhuận (xem hình thật). View trước là đối diện Khách Sạn 3* Tân Sơn Nhất, View sau là đường Nguyễn Văn Trỗi.\",\"+ Phòng mới rất đẹp được ốp lát gạch, tất cả các phòng đều có CỬA SỔ, CÓ BAN CÔNG, MÁY LẠNH, Rèm cửa. Rất thoáng mát.\",\"- Bỏ xe dưới tầng hầm, có bảo vệ trong coi, Sân thượng phơi quần áo có mái che, có 02 bộ ghế đá ngồi thư giản.\",\"- Trong nhà có Thang máy đi lại, Có Camera an ninh quan sát.\",\"- Toilet riêng, đặc biệt có BẾP nấu ăn.\",\"- Internet cáp quang lắp đặt trong phòng rất mạnh. Cáp Tivi.\",\"- Bảo vệ trong coi 24/24 giúp Bạn có cảm giác an toàn, khóa vân tay giờ giấc tự do.\",\"- Diện tích: 25 - 40 m2.\",\"+ Giá: 5tr/tháng.\",\"(MỜI BẠN ĐẾN XEM, CÓ BẢO VỆ DẪN BẠN XEM)\",\"+ Địa chỉ: 205/10A Hoàng Văn Thụ, P.8, Phú Nhuận, Tp. Hồ Chí Minh.\"]', '2e772c8e-00b4-44b0-afbe-6d661fbd4985', '4b40e18b-b0e5-4254-b208-ca9bd314b84d', '0881fb80-b626-41e5-bb75-3cded2d70934', NULL, NULL, '2023-10-05 00:57:32', '2023-10-05 00:57:32'),
