('5e449150-e5fb-4072-a603-7dd6ad49b17c', 'PHÒNG TRỌ CAO CẤP QUẬN 2 - GIỜ GIẤC TỰ DO', 'star star-5', 'OOPN', 'Địa chỉ: 3 Đường Thân Văn Nhiếp, Phường An Phú, Quận 2, Hồ Chí Minh', '1c0fdd4a-53b4-488a-8a4f-2a6af6850479', 'NCT', '3U5N', '2UMD', 'CUID', '[\"Địa chỉ: Số 3 Đường 53 Khu dân cư Văn Minh ( gần chung cư 8 block Novaland) Mặt tiền đường 16 mét!\",\"Cách Mặt tiền Đường Mai Chí Thọ 10m\",\"Liền kề Đô Thị Thủ Thiêm, chỉ cách hầm Thủ Thiêm 3 Km.\",\"Liền kề đại lộ Đông Tây, cao tốc TpHCM – Long Thành.\",\"Nằm giữa trung tâm Quận 2, được bao quanh bởi những đường giao thông huyết mạch, khu dân cư hiện đại bậc nhất Sài Thành. Mang đến cho cư dân những dịch vụ tiện ích hiện đại.\",\"Liền kề cảng Cát Lái.\",\"Cách bệnh viện quận 2 khoảng 5 phút di chuyển, gần trường học.\",\"Cách siêu thị 24 giờ ( seven eleven), siêu thị Coop mart 50 mét.\",\"Từ đây, Qúy khách dễ dàng di chuyển thuận tiện về:\",\"• Cách Chợ Bến Thành chỉ 5 phút đi xe máy\",\"• Quận Bình Thạnh, Hàng xanh chưa đến 10 phút qua Cầu thủ Thiêm\",\"• Khu vực Quận 9 - Thủ Đức, Xa lộ Hà Nội cũng chỉ mất 10 Phút theo Đại lộ Mai Chí Thọ\",\"• Đồng Nai, Vũng Tàu nhanh chóng theo tuyến đường Cao Tốc Long Thành Dầu Dây.\",\"Cách các tiện ích trường học, bệnh viện, siêu thị: bán kính 2km.\",\"- Phòng mới xây 100% bạn là người đầu tiên sử dụng, tiện nghi mới 100%.\",\"- Diện tích mỗi phòng từ 23m2 đến 40m2 có tầng lửng đúc bê tông cho bạn không gian sống riêng tư cho dù bạn là gia đình nhỏ hay nhóm bạn ở chung.\",\"- Khu vực an ninh, yên tĩnh, sang trọng, đẳng cấp.\",\"- Thang máy cho bạn di chuyển dễ dàng.\",\"- Hầm để xe cho không gian sống them rộng mở.\",\"- Bảo vệ an ninh 24/7 bảo đảm cho bạn và tài sản của bạn.\",\"- Dịch vụ linh hoạt tùy thuộc vào nhu cầu của bạn.\",\"- Mỗi phòng đều có khu vực nấu ăn riêng được ốp gạch men, đá hoa cương cao cấp sạch sẽ.\",\"- Không gian RIÊNG TƯ, YÊN TĨNH, TỰ DO, không bị ai làm phiền.\",\"- Bạn được TỰ DO TIẾP KHÁCH người thân, bạn bè.\",\"- Vệ sinh sạch sẽ không gian sử dụ