('7d2ede8d-97af-4dfe-8b35-91dff5dd7502', 'Cho thuê trọ phòng riêng Chung cư Era Town Đức Khải 1tr7-4tr. Có tủ lạnh, máy giặt sử dụng .', 'star star-5', 'OOPN', 'Địa chỉ: Nguyễn Lương Bằng, Phường Phú Mỹ, Quận 7, Hồ Chí Minh', '478efc3b-3686-4155-bf73-7a7d79124172', 'NCT', '1U2N', 'ON2E', 'CUID', '[\"Phòng riêng chung cư diện tích 7-10m2 giá từ 1tr6-2tr3. Tolet chung cạnh phòng.\",\"Phòng tolet riêng giá 3tr2\",\"Phòng tolet riêng giá 3tr5\",\"Phòng full nội thất tolet riêng 4tr\",\"Tiện ích chung cư cao cấp, đầy đủ mọi thứ.\",\"Môi trường an ninh, dân trí cao.\",\"Nhân viên văn phòng và cư dân ở rất đông.\",\"Có tủ lạnh , máy giặt, lao công lau giọn vệ sinh hàng tuần.\",\"Chủ nhà tâm lý, thoải mái.\",\"Vui lòng đọc kỹ bài viết . Xin cảm ơn..!\"]', 'c956fa9f-c11f-4e2b-a053-cc4e28c7c728', 'dddf834f-ec6c-4516-a383-f9b23fc59a44', '3a6a0fb9-c761-4143-b5a6-3ed706228ad6', NULL, NULL, '2023-10-05 00:57:32', '2023-10-05 00:57:32'),
('7ef96fec-8176-46d5-98dc-5f548910fe63', 'PHÒNG TRỌ ĐỐI DIỆN KS 5 SAO TÂN SƠN NHẤT MỚI XÂY RẤT ĐẸP - GẦN CÔNG VIÊN HOÀNG VĂN THỤ', 'star star-5', 'ONON', 'Địa chỉ: 205/10A-B Đường Hoàng Văn Thụ, Phường 8, Quận Phú Nhuận, Hồ Chí Minh', '30eee053-721e-4572-a5b2-c3e6589d938d', 'NCT', '5U7N', '2UMD', 'CUID', '[\"- Phòng đẹp nằm ngay trung tâm quận Phú Nhuận (xem hình thật). View trước là đối diện Khách Sạn 3* Tân Sơn Nhất, View sau là đường Nguyễn Văn Trỗi.\",\"+ Phòng mới rất đẹp được ốp lát gạch, tất cả các phòng đều có CỬA SỔ, CÓ BAN CÔNG, MÁY LẠNH, Rèm cửa. Rất thoáng mát.\",\"- Bỏ xe dưới tầng hầm, có bảo vệ trong coi, Sân thượng phơi quần áo có mái che, có 02 bộ ghế đá ngồi thư giản.\",\"- Trong nhà có Thang máy đi lại, Có Camera an ninh quan sát.\",\"- Toilet riêng, đặc biệt có BẾP nấu ăn.\",\"- Internet cáp quang lắp đặt trong phòng rất mạnh. Cáp Tivi.\",\"- Bảo vệ trong coi 24/24 giúp Bạn có cảm giác an toàn, khóa vân tay giờ giấc tự do.\",\"- Diện tích: 25 - 40 m2.\",\"+ Giá: 5tr/tháng.\",\"(MỜI BẠN ĐẾN XEM, CÓ BẢO VỆ DẪN BẠN XEM)\",\"+ Địa chỉ: 205/10A Hoàng Văn Thụ, P.8, Phú Nhuận, Tp. Hồ Chí Minh.\"]', '8a56f81a-3d15-4c44-987c-ee10de4c9f7e', 'c3829d2c-3c48-42a5-a67e-c2c438684444', 'f52a9dc1-0573-4c68-97a6-c62af859a66a', NULL, NULL, '2023-10-05 00:57:32', '2023-10-05 00:57:32'),
