('89e1ee0b-1595-4c34-9ad4-ce301e428714', 'Cho thuê phòng trọ rộng rãi trong chung cư mini tại Ngõ 256, Nguyễn Lân, Trường Chinh, HN', 'star star-3', 'ONOH', 'Địa chỉ: Số nhà 06 ngõ 256 Phố Nguyễn Lân Đường Trường Chinh, Quận Thanh Xuân, Hà Nội', '3ef8a56e-5c97-4136-8e39-40fbc073971f', 'CTPT', '3U5N', '2UMD', 'NDOE', '[\"Phòng rộng ở được 2 - 3 người\",\"Phòng rộng khép kín đầy đủ tiện nghi: bàn, điêu hòa nóng lạnh, tủ lạnh,...\",\"Giao thông thuận lợi không tắc đường, ngập lụt. \",\"Sinh hoạt giờ giấc tự do. Không chung chủ\",\"Gần đường ô tô có chỗ để ô tô. Giao thông thuận lợi cạnh đường lớn Nguyễn Lân gần chợ, trường đai học lớn Bách Khoa, xây dựng, kinh tế, y, ngân hàng ....\",\"Có chỗ để xe\",\"Nhà cạnh đường lớn giao thông thuận lơi, ko bị tắc đường như Trường Chinh, Lê trọng tấn......\",\"Đc: số nhà 06 ngõ 256 Phố Nguyễn Lân đường Trường Chinh Hà Nội.\",\"Đt liên lạc 0912966199\"]', '7554a548-f24c-416a-a546-50103e285365', '6ce63300-2057-4a9d-aef2-d3eb06a000e6', '0815abac-5997-4f92-a946-ba66cb4c656e', NULL, NULL, '2023-10-05 00:57:32', '2023-10-05 00:57:32'),
('8c69e6e4-44a2-48d2-bc8b-8b1ebc5c5b76', 'PHÒNG TRỌ CAO CẤP TẠI QUẬN TÂN BÌNH', 'star star-5', 'OAHN', 'Địa chỉ: 202 Đường Phạm Văn Hai, Phường 4, Quận Tân Bình, Hồ Chí Minh', '403ef802-dd90-4a86-b971-2c80f82935f0', 'NCT', '3U5N', '2UMD', 'CUID', '[\"Giá 3tr/ tháng\",\"Cách sân bay Tân Sơn Nhất 3 phút đi xe máy\",\"Cách chợ Phạm Văn Hai 1 phút xe máy\",\"Rất gần Quận 1 và Quận 3 : di chuyển thuận lợi bằng đường Hoàng Sa Trường Sa.\",\"Tiện ích xung quanh gồm Biện Viện, Trường Học, Chợ, Siêu Thị, Nằm rất gần bờ kè kênh Nhiêu Lộc nên rất thuận tiện đi làm về giờ tan tầm, tránh được kẹt xe.\",\"Diện tích mỗi phòng từ 25m2 đến 27m2 có tầng lửng cho bạn không gian sống riêng tư cho dù bạn là gia đình nhỏ hay nhóm bạn ở chung\",\"Khu vực an ninh, yên tĩnh, thuận tiện trong mọi sinh hoạt\",\"Có bãi gửi xe riêng cho không gian sống them rộng mở.\",\"Bảo vệ an ninh 24/7 bảo đảm cho bạn và tài sản của bạn.\",\"Dịch vụ linh hoạt tùy thuộc vào nhu cầu của bạn.\",\"Không gian RIÊNG TƯ, YÊN TĨNH, TỰ DO, không bị ai làm phiền.\",\"Bạn được TỰ DO TIẾP KHÁCH người thân, bạn bè.\",\"Vệ sinh sạch sẽ không gian sử dụng chung 24/7\",\"Địa chỉ liên hệ : 380/290A Phạm Văn Hai (Đi vào bằng hẻm 202 Phạm Văn Hai)\",\"Vui Lòng Liên Hệ Số Điện Thoại : 090 9913596 cô Linh để xem phòng\",\"0796252354 Đạt\",\"Hoặc 08.8899.2345 khánh\"]', '14be06e1-1b4d-4474-a863-61323bd57fb3', 'ec5bffae-6aa4-4139-9076-05a0d1bbbb77', '6bbb8cba-4daa-405e-bd61-e2c7333048d7', NULL, NULL, '2023-10-05 00:57:32', '2023-10-05 00:57:32'),
('9097bacd-91f7-4722-aebb-38746b65d2ea', 'Chính chủ cho thuê phòng trọ 475/36A Cách Mạng Tháng 8, P.13, Q10.', 'star star-3', 'OQPN', 'Địa chỉ: 4 Đường Cách Mạng Tháng Tám, Phường 13, Quận 10, Hồ Chí Minh', '30e3aaf4-15fd-4f21-a083-ed5d60ba3e33', 'NCT', '3U5N', '2UMD', 'CUID', '[\"Chính chủ cho thuê phòng trọ 475/36A Cách Mạng Tháng 8, P13, Q10. Hẻm rộng , an ninh, yên tĩnh .Khu vực gần trung tâm quận 1, gần CLB Lan Anh.Phòng rộng rãi, sạch sẽ,có ban công rộng, toilet riêng trong phòng.\",\"Phòng đầy đủ tiện nghi , giường , tủ áo, máy lạnh. Bãi giữ xe trong nhà, giờ giấc tự do, không chung chủ. Điện 3500k/kw. Nước 100k .Wifi miễn phí.\",\"LH C Truc 0909965189\"]', 'f6014a37-06d5-4a0d-b9a9-20009a364230', '98b88ecd-fbc4-437c-8713-8c64ce543c66', '9b83e62a-06cd-43f4-b63e-4fefa4475d00', NULL, NULL, '2023-10-05 00:57:32', '2023-10-05 00:57:32'),
('93d1096b-0eb1-4a97-9e55-ef5a72508153', 'PHÒNG CHO THUÊ NGAY LOTTE Q.7 - CHỈ TỪ 3.4TR - BAO GIÁ TỐT - Alo 0988.373.731', 'star star-4', 'OOPN', 'Địa chỉ: 80 Đường số 3, Phường Tân Kiểng, Quận 7, Hồ Chí Minh', '46aa5ff7-a87f-41fb-a1b2-34fdd34fe776', 'CTCH', '3U5N', '2UMD', 'CUID', '[\"Các tiện ích chỉ có ở tại Fullhouse ngay Lotte Q.7. 100% dân trí cao, Sạch đẹp - Văn minh - Nhân ái\",\"Ngay Lotte Q.7 (đi bộ 2 phút đến đại siêu thị)! Alo ngay: 0988.373.731 Ms Hòa.\",\"Căn phòng dành cho bạn thì đầy đủ tiện nghi, tiết kiệm điện và bảo vệ môi trường với hệ đèn LED - Nước nóng năng lượng mặt trời - Máy lạnh Inverter - WC và bếp riêng tiện nghi và tự do.\",\"Tòa nhà luôn được vệ sinh sạch sẽ để bảo vệ sức khỏa toàn bộ dân cư.Tòa nhà xài hệ thống NLMT và máy lạnh Inverter giúp tiết kiệm điện.\",\"Tòa nhà 8 tầng mới xây sạch,đẹp,văn minh thoáng mát, an ninh. Liền kề 5 phút đến Q1, Q4, Q5, Q8, Crescent Mall, SC Vivo, vị trí vàng đẹp Q. 7...Thuê chỗ ở bây giờ cần phải đảm bảo an toàn PCCC tuyệt đối. Tòa nhà căn hộ cho thuê cao cấp của chúng tôi có thẩm duyệt PCCC và đã nghiệm thu PCCC kèm theo bảo hiểm đảm bảo an toàn cho toàn bộ cư dân sống và làm việc tại đây, có an cư, an toàn mới lạc nghiệp.\",\"Giá từ 3.4 - 5 triệu/tháng, bao giá tốt khắp khu vực.\",\"Alo ngay: 0988.373.731 Ms Hòa.\",\"Đảm bảo 100% sự hài lòng.\",\"80 Đường Số 03, P. Tân Kiểng, Q. 7 - LH: 0988.373.731 Ms Hòa.\"]', 'a1ea797e-86b2-439e-adb3-f65ef91577bc', '2e6217ac-0126-4700-813e-8e1674db37e3', 'cddb3ebb-dd95-42e9-83d8-146f29e8c14e', NULL, NULL, '2023-10-05 00:57:32', '2023-10-05 00:57:32'),
