('ee750793-0262-4e27-a12d-57c6a3fb57f2', 'Khám phá phòng trọ mới xây đẹp và tiện nghi tại vị trí đắc địa - Liên hệ ngay!', 'star star-3', 'OQPN', 'Địa chỉ: Đường An Phú Đông 1, Phường Thạnh Lộc, Quận 12, Hồ Chí Minh', '300d6e77-4c5f-49c9-8a40-3130e8fd293c', 'CTPT', '2U3N', '2UMD', 'CUID', '[\"Khám phá phòng trọ cực kỳ hấp dẫn và tiện nghi:\",\"Diện tích rộng rãi (20-25m2) để bạn và gia đình thoải mái sinh hoạt.\",\"Ban công riêng, khu vực phơi đồ độc lập, kết nối Wifi tốc độ cao, hệ thống cửa vân tay an ninh riêng biệt.\",\"Vị trí thuận tiện di chuyển đến các quận trung tâm như Nguyễn Văn Quá, Cầu Tham Lương, Trường Chinh, Quang Trung Gò Vấp, Chợ Hạnh Thông Tây, Công Viên Phần Mềm và gần các trường đại học Hoa Sen, FPT. Phù hợp cho văn phòng, sinh viên và gia đình nhỏ.\",\"Phòng mới đẹp, được trang bị nội thất tiện nghi.\",\"Giường và gác cao tiện lợi.\",\"Không giới hạn số người ở.\",\"Hầm xe rộng rãi, thuận tiện.\",\"Khu vực an ninh, yên tĩnh, bảo vệ 24/7, không chung chủ, tự do giờ giấc.\",\"Đặc biệt, giảm giá phí dịch vụ cho hợp đồng 12 tháng.\",\"Cam kết không tăng giá suốt thời gian hợp đồng, ưu tiên khách hàng lịch sự, hợp đồng lâu dài.\",\"Với kinh nghiệm và sự nhiệt tình của chúng tôi trong kinh doanh nhà trọ, chắc chắn sẽ làm bạn hài lòng.\",\"Hãy liên hệ ngay để được tham quan phòng miễn phí và trải nghiệm chất lượng tuyệt vời này. Số điện thoại liên hệ: Mr Vinh - 0777964968\"]', 'f20de47d-f579-4b24-b0b4-94510925de9d', '985bfa52-f2af-415d-b81a-f3b9d70d4788', '3bb7bd31-9b0a-4716-b6dd-0132442d1ca6', NULL, NULL, '2023-10-05 00:57:32', '2023-10-05 00:57:32'),
