('f6b7e726-ecec-45fa-bb14-f7bb49e00b06', 'Phòng 30m2 Nguyễn Thị Thập cạnh Lotte Q7', 'star star-4', 'OOPN', 'Địa chỉ: Nguyễn Thị Thập, Phường Tân Phong, Quận 7, Hồ Chí Minh', '1ec76e8c-de6d-47b4-824e-8407de8b094d', 'CTCH', '3U5N', '3UMD', 'CUID', '[\"Bên mình trống 1 phòng như hình có thể chuyển vào ở luôn, phòng full nội thất: giường nệm, tủ quần áo, máy lạnh, tủ lạnh, máy giặt, ghế salon, bàn bếp, máy nước nóng năng lượng mặt trời...\",\"- Vị trí đường Nguyễn Thị Thập, cách lotte chỉ 500m, thuận tiện qua trường TĐT, NTT, MKT, qua Q1, Q4 chỉ 5 phút.\",\"- Khu vực dân cư yên tỉnh thích hợp nghỉ ngơi, gần BHX, cửa hàng tiện ích, caàe, trà sữa...\",\"- Liên hệ zalo để tư vấn kỹ hơn\"]', 'e0a45acc-700c-468a-945e-493e807690d1', '792a1d84-93a5-4682-824e-a02a85e8f03a', '0ce99d29-a962-4c03-8be9-327dc20607ad', NULL, NULL, '2023-10-05 00:57:32', '2023-10-05 00:57:32'),
('f7d5ff22-991d-4e49-8b61-a2d2c6a9b72e', 'Cho thuê phòng trọ mới Đường Lương Thế Vinh, Phường Tân Thới Hòa, Quận Tân Phú (gần Đầm Sen)', 'star star-5', 'OAHN', 'Địa chỉ: 48/13 Đường Lương Thế Vinh, Phường Tân Thới Hòa, Quận Tân Phú, Hồ Chí Minh', '34d73e98-0022-401d-9cef-4398f908c627', 'CTMB', '1U2N', '2UMD', 'CUID', '[\"Giá Phòng từ 1800k đến xem đảm bảo ưng ý, cam kết hình đúng với thực tế\",\"Phòng mới sửa chữa mới năm 2023 , địa chỉ 48/13 Lương Thế Vinh Phường Tân Thế Hòa, Q.Tân Phú, nhà hẽm xe hơi lộ giới 5m .\",\"Diện Tích 12m + 8m ( gác lững )\",\"Phòng có tolet riêng, cửa sổ, ban công, có phòng dưới trệt\",\"Cho nấu ăn trong phòng, Ở được 2-4 người, bạn bè lại chơi thoãi mái.\",\"Miễn phí internet, wifi, truyền hình cáp, Camera 15 cái ( an ninh quan sát không góc chết )\",\"Để xe trong sân nhà thoáng mát có bảo vệ coi 24/24\",\"Vị trí gần Đầm Sen, thuận tiện qua lại Q.6, Q.11, Tân Phú\",\"Điện 3,5k/ 1 ký, nước 70k / 1 người, xe 100k/ 1 chiếc .\",\"Xe để sân sau nhà có người quản lý và trông coi ( không chung chủ ) giúp bạn có cảm giác an toàn, thoải mái\",\"LH : 0938864405 ( Cường )\",\"LH zalo : 0938864405 ( Cường Phạm )\"]', '2bff2e97-c695-4242-a10d-4ec73f7c9460', 'c97b9903-46bc-4e4c-a7f1-58b2db59abd4', 'e95d9356-8858-45c7-b3f9-6646f079ef73', NULL, NULL, '2023-10-05 00:57:32', '2023-10-05 00:57:32'),
('f9488da2-1146-4ebf-bcae-dfd05e70ff94', 'CHO THUÊ PHÒNG TRỌ MỚI CHÍNH CHỦ, GIẢM GIÁ, QUẬN TÂN PHÚ - GẦN BÊN TRƯỜNG ĐẠI HỌC CÔNG NGHỆ THỰC PHẨM', 'star star-5', 'OAHN', 'Địa chỉ: 24 Đường Sơn Kỳ, Phường Sơn Kỳ, Quận Tân Phú, Hồ Chí Minh', '4ac036c7-2563-47c7-8c74-6782ff281bee', 'CTCH', '2U3N', '2UMD', 'CUID', '[\"PHÒNG TRỌ 24 SƠN KỲ TÂN PHÚ, GẦN ĐH CÔNG NGHỆ THỰC PHẨM\",\"- Cách trường Đại Học Công nghệ Thực Phẩm 700m, cách AeOnMall Tân Phú 500m, Gần eTown, PanDoRa Trường Chinh,.... thuận tiện đi lại các quận.\",\"- Phòng có CỬA SỔ, nhiều phòng có BAN CÔNG, đảm bảo ánh sáng ban ngày rất thoáng mát. (Xem hình thật)\",\"- Toilet trong phòng đầy đủ các thiết bị vệ sinh, có kệ BẾP nấu ăn, có GÁC LỮNG các phòng được ốp gạch cao sạch sẽ.\",\"- Trong nhà có Thang máy đi lại, Có Camera an ninh quan sát, có PCCC tự động\",\"- Internet cáp quang mạnh, nhanh. Có cáp Tivi\",\"- Bỏ xe dưới tầng trệt có bảo vệ trong coi. Khóa vân tay giờ giấc tự do.\",\"- Bảo vệ trong coi 24/24 (không chung chủ) giúp Bạn có cảm giác an toàn, được bảo vệ.\",\"___________________________\",\"- Địa chỉ: 24 Sơn Kỳ, phường Sơn Kỳ, quận Tân Phú, Tp. Hồ Chí Minh.\",\"- Diện tích phòng: Từ 20 m2 – 25 m2.\",\"- Giá Rẻ: 2,8tr – 3tr/tháng.\",\"___________________________\",\"(MỜI BẠN ĐẾN XEM PHÒNG, CÓ QUẢN LÝ TIẾP KHÁCH)\",\"Liên hệ: 0918 18 00 57 hoặc 0931897679  A Hiếu.\"]', 'ecd19166-7a6e-432f-841d-9ec3981b1086', 'f4cf9357-ecfb-4822-8c11-034dea8d0ceb', '6170d18c-e71a-413a-8080-08498c8cc87b', NULL, NULL, '2023-10-05 00:57:32', '2023-10-05 00:57:32'),
('fa43519d-d1a1-4c87-a7b0-14a28b3acb88', 'PHÒNG TRỌ CAO CẤP TẠI QUẬN TÂN BÌNH', 'star star-5', 'OAHN', 'Địa chỉ: 202 Đường Phạm Văn Hai, Phường 4, Quận Tân Bình, Hồ Chí Minh', '50e23036-2d41-4da8-ac39-19dadec3d759', 'CTPT', '3U5N', '2UMD', 'CUID', '[\"Giá 3tr/ tháng\",\"Cách sân bay Tân Sơn Nhất 3 phút đi xe máy\",\"Cách chợ Phạm Văn Hai 1 phút xe máy\",\"Rất gần Quận 1 và Quận 3 : di chuyển thuận lợi bằng đường Hoàng Sa Trường Sa.\",\"Tiện ích xung quanh gồm Biện Viện, Trường Học, Chợ, Siêu Thị, Nằm rất gần bờ kè kênh Nhiêu Lộc nên rất thuận tiện đi làm về giờ tan tầm, tránh được kẹt xe.\",\"Diện tích mỗi phòng từ 25m2 đến 27m2 có tầng lửng cho bạn không gian sống riêng tư cho dù bạn là gia đình nhỏ hay nhóm bạn ở chung\",\"Khu vực an ninh, yên tĩnh, thuận tiện trong mọi sinh hoạt\",\"Có bãi gửi xe riêng cho không gian sống them rộng mở.\",\"Bảo vệ an ninh 24/7 bảo đảm cho bạn và tài sản của bạn.\",\"Dịch vụ linh hoạt tùy thuộc vào nhu cầu của bạn.\",\"Không gian RIÊNG TƯ, YÊN TĨNH, TỰ DO, không bị ai làm phiền.\",\"Bạn được TỰ DO TIẾP KHÁCH người thân, bạn bè.\",\"Vệ sinh sạch sẽ không gian sử dụng chung 24/7\",\"Địa chỉ liên hệ : 380/290A Phạm Văn Hai (Đi vào bằng hẻm 202 Phạm Văn Hai)\",\"Vui Lòng Liên Hệ Số Điện Thoại : 090 9913596 cô Linh để xem phòng\",\"0796252354 Đạt\",\"Hoặc 08.8899.2345 khánh\"]', 'f70979b4-fd24-41c8-a25c-95158048eadf', '4159efa7-32a0-479c-bc8e-2839a0bd688d', '50628fa4-4b14-46bc-be40-227521c068c4', NULL, NULL, '2023-10-05 00:57:32', '2023-10-05 00:57:32'),
