('fdba3bc5-dd29-4f8f-8395-a80f4bdbf9a8', 'Cho thuê trọ phòng riêng Chung cư Era Town Đức Khải 1tr7-4tr. Có tủ lạnh, máy giặt sử dụng .', 'star star-5', 'OOPN', 'Địa chỉ: Nguyễn Lương Bằng, Phường Phú Mỹ, Quận 7, Hồ Chí Minh', '2041bc5b-47f8-4bf3-b3c9-29ece838b703', 'CTCH', '1U2N', 'ON2E', 'CUID', '[\"Phòng riêng chung cư diện tích 7-10m2 giá từ 1tr6-2tr3. Tolet chung cạnh phòng.\",\"Phòng tolet riêng giá 3tr2\",\"Phòng tolet riêng giá 3tr5\",\"Phòng full nội thất tolet riêng 4tr\",\"Tiện ích chung cư cao cấp, đầy đủ mọi thứ.\",\"Môi trường an ninh, dân trí cao.\",\"Nhân viên văn phòng và cư dân ở rất đông.\",\"Có tủ lạnh , máy giặt, lao công lau giọn vệ sinh hàng tuần.\",\"Chủ nhà tâm lý, thoải mái.\",\"Vui lòng đọc kỹ bài viết . Xin cảm ơn..!\"]', 'c89f84a8-a672-4c71-b2cc-34bef2b51ae5', '74d08458-2194-44b2-a4d3-d4a745e9eb05', 'cce3caa2-8591-49f0-aa1b-168f4d929e62', NULL, NULL, '2023-10-05 00:57:32', '2023-10-05 00:57:32'),
